import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "./Components/Login";
import Registration from "./Components/Register";
import Home from "./Pages/Home";
import Navbar from "./Components/Navbar";
import Account from "./Pages/Account";
import Song from "./Pages/Song/SongPage"
import ListSong from "./Pages/Song/ListSong";
import EditSongPage from "./Pages/Song/EditSongPage";
function App() {
    return (
        <BrowserRouter>
            <Navbar/>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/login" element={<Login />} />
                <Route path="/register" element={<Registration />} />
                <Route path="/Account" element={<Account/>}/>
                <Route path="/Song" element={<Song/>}/>
                <Route path="/ListSong" element={<ListSong/>}/>
                <Route path="/EditSong/:SongId" element={<EditSongPage/>}/>
            </Routes>
        </BrowserRouter>
    );
}

export default App;
